import { useSelector } from 'react-redux'

const Counter = () => {
    const count=useSelector( (state)=>{
       state.counter.value
    })
  return (
    <div>
        <button></button>
        <br></br>
        <br></br>
        <div>{count}</div>
        <br></br>
        <br></br>
        <button></button>
      
    </div>
  )
}

export default Counter
